import React from "react";
import "./App.css";
import book from "./data/book.png";
import Form from "./Components/Form/Form";

function App() {
  return (
    <div className="App" styles={{ backgroundImage: `url(${book})` }}>
      {/* <div className="App-Component"> */}
      <Form styles={{ backgroundImage: `url(${book})` }} />
      {/* </div> */}
    </div>
  );
}

export default App;
